export const searchBarVariant = {
  initial: { opacity: 0, y: "30%", scale: 0.8 },
  animate: {
    opacity: 1,
    y: 0,
    scale: 1,
    transition: {
      opacity: {
        delay: 0.25,
      },
      ease: "easeInOut",
      duration: 0.3,
    },
  },
  exit: { opacity: 0, y: "20%" },
};
